import React from "react";
import "./style.css";

const Navbar = () => {
  return (
    <div className="container-nav">
      <div>Logo</div>
      <nav>
        <li>
          <a href="">Home</a>
        </li>
        <li>
          <a href="">About</a>
        </li>
        <li>
          <a href="">Services</a>
        </li>
        <li>
          <a href="">Contact</a>
        </li>
      </nav>
    </div>
  );
};

export default Navbar;
